#include <fstream>

int main() {
    std::ifstream in("ucif.in");
    std::ofstream out("ucif.out");
    int n;
    in >> n;
    int sum = 0;
    for (int i = 1; i <= n; i++) {
        int pow = 1;
        for (int j = 1; j <= i; j++) {
            pow *= i;
        }
        sum += pow;
    }
    out << sum % 10 << '\n';
    return 0;
}
